import Card from 'react-bootstrap/Card'

const IntroText = () => {
  return (
    <Card
      style={{
        backgroundColor: "#c84ba9",
        height: "150px",
        margin: "auto",
        marginTop: "20px",
        width: "600px",
      }}
    >
      <h1 style={{color: 'white', margin: 'auto'}}>Delicious Food, Delivered To You</h1>
      <p style={{color: 'white'}}> </p>
    </Card>
  );
};

export default IntroText
